from numpy import prod
from itertools import combinations
def a(n):
    ans = 1  # empty set
    for r in range(1, n):
        for s in combinations(range(2, n+1), r):
            strsp = str(prod(s))
            ans += strsp==strsp[::-1]
    return ans
print([a(n) for n in range(20)])  # _Michael S. Branicky_, Dec 08 2020

